    def __init__(self, first, last):
        self.first = first
        self.last = last

    def __initials__(self):
        return self.first[0] + " " + self.last[0]

    def __str__(self):
        return self.first + " " + self.last

def main():
    p1 = Person("Barbara", "Ericson")
    print(p1)
    print(p1.initials())

main()

